const Bookmarks = ({ theme }) => {
  return (
    <div className={`${theme.card} rounded shadow p-4`}>
      <h2 className="h5 fw-semibold">Bookmarks</h2>
      <p>Your bookmarked verses will appear here...</p>
    </div>
  );
};

export default Bookmarks;
